const AdminStore = {
    state: {
        artists: [
            { id: 1001, name: "Edvard Munch", born: 1863, imgSrc: "edvard.jpg", text: "Edvard Munch was a Norwegian painter. His best known work, The Scream, has become one of the most iconic images of world art. His childhood was overshadowed by illness, bereavement and the dread of inheriting a mental condition that ran in the family. Studying at the Royal School of Art and Design in Kristiania (today's Oslo), Munch began to live a bohemian life under the influence of nihilist Hans Jæger, who urged him to paint his own emotional and psychological state ('soul painting'). From this emerged his distinctive style." },
            { id: 1002, name: "Andy Warhol", born: 1928, imgSrc: "warhol.jpg", text: "Andy Warhol born Andrew Warhola; August 6, 1928 – February 22, 1987) was an American artist, film director, and producer who was a leading figure in the visual art movement known as pop art. His works explore the relationship between artistic expression, advertising, and celebrity culture that flourished by the 1960s, and span a variety of media, including painting, silkscreening, photography, film, and sculpture. Some of his best known works include the silkscreen paintings Campbell's Soup Cans (1962) and Marilyn Diptych (1962), the experimental film Chelsea Girls (1966), and the multimedia events known as the Exploding Plastic Inevitable (1966–67)." },
            { id: 1003, name: "Salvador Dali", born: 1904, imgSrc: "dali.jpg", text: "Born in Figueres, Catalonia, Dalí was a skilled draftsman, best known for the striking and bizarre images in his work. His painterly skills are often attributed to the influence of Renaissance masters.[3][4] His best-known work, The Persistence of Memory, was completed in August 1931, and is one of the most recognisable Surrealist paintings. Dalí's expansive artistic repertoire included film, sculpture, and photography, at times in collaboration with a range of artists in a variety of media."},
            { id: 1000, name: "Odd Nerdrum", born: 1944, imgSrc: "odd.jpg", text: "Odd Nerdrum is a Swedish-born, Norwegian figurative painter whose work is held by museums worldwide. Themes and style in Nerdrum's work reference anecdote and narrative. Primary influences by the painters Rembrandt and Caravaggio help place his work in direct conflict with the abstraction and conceptual art considered acceptable in much of Norway. Nerdrum creates six to eight paintings a year. They include still life paintings of small, everyday objects (like bricks), portraits and self-portraits, and large paintings allegorical and apocalyptic in nature. The figures in Nerdrum's paintings are often dressed as if from another time and place." }

        ]
    },
    getAllArtists(){
        return this.state.artists.map( artist => artist);
    },
    getArtistById(id){
        return this.state.artists.find( artist => artist.id == id );
    }
}


export default AdminStore;
